import React, { useEffect, useState } from "react"
import './admin.css'

function Adminlog() {

    let [form , setform] = useState([])

    const fetch = async (req,res) => {
    await axios
    .get("http://localhost:7000/getlawerd")
    .then((res) => {
        console.log(res.data)
        setform(res.data)
    })
    .catch((err) => {
        console.log(`${err}`)
    })

    }



useEffect(() => {
    fetch()
},[])

    return(
        <div className="admin-out">
           <div className="admin-card">
            {form.map (value => (
                <div>
                    <div>
                        <img src={`http://localhost:7000/static/${value.originalname}`}/>
                    </div>
                    <p>{value.name}</p>
                    <p>{value.age}</p>
                    <p>{value.exp}</p>
                    <p>{value.location}</p>

                </div>
            )

            )}

           </div>
        </div>
    )
}

export default  Adminlog
